9a04ff67-0b87-4296-b7f9-daa8baf0bd2c	Andaman Island Standard	21999	\N	"[{\\"id\\":\\"day-1768029204219\\",\\"day\\":1,\\"title\\":\\"Arrival in Port Blair\\",\\"description\\":\\"Arrive at Veer Savarkar Airport, Port Blair\\\\n\\\\nTransfer to hotel and check-in\\\\n\\\\nAfternoon:\\\\n\\\\nVisit Cellular Jail (heritage walk)\\\\n\\\\nAttend the Light & Sound Show in the evening\\\\n\\\\nLeisure dinner\\\\n\\\\nOvernight in Port Blair\\"},{\\"id\\":\\"day-1768029253290\\",\\"day\\":2,\\"title\\":\\"Port Blair  Ross Island + North Bay (Coral Island) :\\",\\"description\\":\\"Ross and North Island -After Morning Breakfast Visit to Historical Ross Island ( British Capital of Andaman ), Visit Coral Island (North Bey Island)  You Can Enjoy underwater life from Glass Bottom Boat ride, Banana Boat, Scuba, Sea walk, etc at your own Expenses. Overnight stay at Port Blair.\\"},{\\"id\\":\\"day-1768029271786\\",\\"day\\":3,\\"title\\":\\"Port Blair  Havelock Island:\\",\\"description\\":\\"Our driver will pick you up from your hotel at around 06:00 AM. You will be provided packed breakfast by the hotel.\\\\nThe Cruise to Havelock Island leaves at 7.30 AM from Chatham Jetty. The cruise reaches Havelock Island by 09:30 AM.\\\\nUpon arrival, Your Luggage Transfer to the hotel and head to *Kalapathar Beach*. \\\\n Return for CheckIn And lunch and later visit *Radhanagar Beach* for a stunning sunset. \\\\n Relax by the seaside before dinner. \\\\nOvernight Stay At Havelock\\"},{\\"id\\":\\"day-1768029289148\\",\\"day\\":4,\\"title\\":\\"Havelock Island to Neil Island :\\",\\"description\\":\\"Havelock Island to Neil Island  Known for its magnificent biodiversity, unexplored coral reefs, white sandy beaches, and tropical woodlands, Neil Island is perfect for a much needed time out. Enjoy the beauty of Neil Island. Stay At Neil.\\"},{\\"id\\":\\"day-1768029308314\\",\\"day\\":5,\\"title\\":\\" Neil Island To Port Blair :\\",\\"description\\":\\"Neil Island  Port Blair . Hotel Check In stay at Port Blair, Port Blair City Tour. Stay At Port Blair.\\"},{\\"id\\":\\"day-1768029329906\\",\\"day\\":6,\\"title\\":\\"Baratang Island and Jarawa Tribe :\\",\\"description\\":\\" Start early for *Baratang Island*. \\\\n Journey through tropical forests and the *Jarawa Tribal Reserve*. \\\\n Explore the *Limestone Caves (Extra Cost)* after a thrilling boat ride. \\\\n Return to Port Blair in the evening. \\"},{\\"id\\":\\"day-1768029349017\\",\\"day\\":7,\\"title\\":\\" Departure :\\",\\"description\\":\\" After breakfast, check out and head to the airport for your return flight. \\\\n Carry back unforgettable memories of your Andaman adventure! \\"}]"	1. Accommodation: Double/Triple sharing basis in hotels at Port Blair, Havelock, and Neil Island. \n2. Transport: Private AC vehicle for all sightseeing and transfers across all islands. \n3. Transfers: Airport pick-up and drop, along with all inter-island transfers. \n4. Tickets & Permits: All entry tickets, private ferry tickets (Port Blair to Havelock, Havelock to Neil, Neil to Port Blair via Makruzz, Green Ocean, or Nautika), and permit charges. \n5. Meals: Breakfast, lunch, and dinner, along. \n6. Assistance: Field executive assistance at all major entry/exit points (airport, jetty, jail, water sports complex, etc.). 	 Flight Tickets: Airfare is not included. \n Extra Meals: Evening snacks, bed tea, and any personal meal orders. \n Personal Activities: Charges for personal activities like Elephant Beach boat rides, Limestone Cave boat charges, etc. \n Room Service & Special Orders: Not included. \n Beverages: Alcoholic and non-alcoholic drinks are not included. \n Camera Tickets: Professional camera tickets at sightseeing spots are not included. \n Additional Costs: Any extra sightseeing or vehicle usage beyond the itinerary will be at your own cost. \n Natural Calamities: Costs arising due to natural disasters, roadblocks, political unrest, etc., will be borne by the client. \n 5% GST	606959c5-891a-47c6-a102-4320f11276cf	2026-01-10 07:20:07.243292+00	2026-01-10 07:20:07.243292+00	7	6	dmc	"[{\\"id\\":\\"date-1768029465166\\",\\"group_dates\\":\\"06-02-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029498585\\",\\"group_dates\\":\\"13-02-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029512361\\",\\"group_dates\\":\\"20-02-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029525369\\",\\"group_dates\\":\\"27-02-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029536410\\",\\"group_dates\\":\\"06-03-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029549825\\",\\"group_dates\\":\\"13-03-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029564009\\",\\"group_dates\\":\\"20-03-2026\\",\\"capacity\\":24},{\\"id\\":\\"date-1768029576089\\",\\"group_dates\\":\\"27-03-2026\\",\\"capacity\\":24}]"	\N	\N	"[{\\"id\\":\\"hotel-1768029418764\\",\\"location\\":\\"Port Blair\\",\\"name\\":\\"The Tamarind Tree Hotel & Restaurant / Similar\\"},{\\"id\\":\\"hotel-1768029433730\\",\\"location\\":\\"Havelock Island \\",\\"name\\":\\"Radhakrishna Hotel / Similar\\"},{\\"id\\":\\"hotel-1768029447810\\",\\"location\\":\\"Neil Island\\",\\"name\\":\\"Hotel Amulya / Similar\\"}]"	Platinum Tours And Travels	\N	10 Important Tips Before Your Andaman Trip\n\n1.No passport is required to visit Andaman. It is a part of India, so carrying your Aadhaar or Voter ID is enough.(For Indian Nation) \n\n2.Most hotels in Andaman have a check-in time of 12:00 PM, but check-out is usually by 8:30 AM. Hotel policies are strictly followed.\n\n3.The entry fee for Limestone Caves is approximately 1000 per person.\n\n4.Except for Port Blair, Jio and Vodafone networks are almost unavailable. BSNL provides the best coverage, while Airtel works in some places. Most hotels offer Wi-Fi, but the speed is slow.\n\n5.Carry sufficient cash, as UPI payments may not work properly.\n\n6.Andaman is hot and humid most of the time, so carry an umbrella and sunscreen.\n\n7.Vehicles are parked near the jetties at every point, so be prepared for some walking in the sun after getting off the cruise.\n\n8.Food in Andaman is expensive. Carry dry snacks if possible.\n\n9.On the day of the Baratang trip, leaving by 3:00 AM is the best option for a smooth journey.\n\n10. Per Day Water Expenses Minimum 150-200 Rupee .. 1 Ltr Water Bottle Not Available In Andaman. Minimum 2 Ltr Available	\N	INR	\N	\N	Andaman	\N	\N	\N	\N	\N	\N	\N	STT-DMC-006	f	\N	f
