38ba6a8d-1553-4eb3-914f-586727cf7269	Darjeeling - Gangtok 2026	9999	\N	"[{\\"id\\":\\"day-1768136675244\\",\\"day\\":1,\\"title\\":\\"NJP to Gangtok \\",\\"description\\":\\" Arrival at Gangtok Your adventure starts the moment you step out at NJP Railway Station. Our team will be waiting to welcome you warmly, and together well set off on a picturesque drive to Gangtok, the capital of Sikkim. The winding roads, misty valleys, and mountain streams will slowly introduce you to the magic of the Himalayas. By afternoon, we check into the hotel. After some rest, the evening is yours to soak in the vibrant charm of MG Marg, where local cafes, shops, and colorful lights create a festive atmosphere.  Meals: Lunch & Dinner included  Overnight stay at Gangtok\\"},{\\"id\\":\\"day-1768136677865\\",\\"day\\":2,\\"title\\":\\"Gangtok local sightseeing \\",\\"description\\":\\"Tsomgo Lake, Baba Mandir & Nathula Pass This is the day youve been waiting for  a journey to the high Himalayas. After breakfast, we begin our thrilling excursion. First stop: Tsomgo Lake, a crystal-blue glacial lake surrounded by snow-clad peaks. Then, we pay homage at the legendary Baba Harbhajan Mandir, a place of faith and stories. And finally, the crown jewel  Nathula Pass (14,140 ft.), standing tall on the Indo-China border, where youll feel the pride of India and the chill of the Himalayas in one breath. By evening, we return to Gangtok with memories etched forever.  Meals: Breakfast, Lunch & Dinner included  Overnight stay at Gangtok\\"},{\\"id\\":\\"day-1768137061316\\",\\"day\\":3,\\"title\\":\\"Gangtok to darjeeling \\",\\"description\\":\\"After breakfast, we bid farewell to Gangtok and set off for the Queen of Hills  Darjeeling. The drive itself is a delight, with tea gardens rolling down the hillsides and mountain streams crossing our path. By evening, we arrive in Darjeeling, check into our hotel, and take a leisurely walk along Mall Road, where the colonial charm and Himalayan breeze instantly capture your heart.  Meals: Breakfast, Lunch & Dinner included  Overnight stay at Darjeeling\\"},{\\"id\\":\\"day-1768137132635\\",\\"day\\":4,\\"title\\":\\"Darjeeling local sightseeing \\",\\"description\\":\\"Wake up before dawn  because todays sunrise will be unlike any other. At Tiger Hill, watch the first golden rays of the sun kiss the mighty Kanchenjunga peak   a sight travelers treasure for a lifetime. On the way back, explore Ghoom Monastery and Batasia Loop, where the famous Toy Train curls through mountain tracks. After breakfast, we continue with Darjeelings gems  HMI, Tenzing Rock, Tea Garden, Peace Pagoda, Ropeway  every stop telling a new story of nature, adventure, and culture.  Meals: Breakfast, Lunch & Dinner included  Overnight stay at Darjeeling\\"},{\\"id\\":\\"day-1768137216587\\",\\"day\\":5,\\"title\\":\\"Darjeeling to njp \\",\\"description\\":\\"The final leg of your Himalayan story begins after breakfast as we check out from Darjeeling. On our way back to NJP, we take the scenic route through Simana View Point, Gopaldara Tea Estate, Lepchajagat, and Mirik Lake. Each stop is a last chance to capture the beauty of the hills in your heart (and camera ). After lunch en route, we reach NJP by evening, carrying with us not just photographs but a thousand memories of the Snow Trails of Sikkim & Darjeeling.  Meals: Breakfast & Lunch included\\"}]"	 NJP  NJP Complete Transportation\n Accommodation on family-wise room allocation\n All Meals (Breakfast + Lunch + Dinner)\n Required permits\n All sightseeing as per itinerary (including Nathula Pass*)	Entry fees at sightseeing points\n Personal expenses / outside food\n Parking charges\n Train/Air Fare\n Gangtok Local Taxi (INR 200-300/Taxi)\n Special arrangements (bonfire, barbeque, etc.)\n 5% GST	904ae5c8-6f8d-4d51-8c17-2613e289aab3	2026-01-11 13:20:42.468168+00	2026-01-28 07:08:16.058196+00	5	4	group	"[{\\"id\\":\\"date-1768542098143\\",\\"group_dates\\":\\"2026-02-10\\",\\"capacity\\":8},{\\"id\\":\\"date-1769584078888\\",\\"group_dates\\":\\"2026-03-10\\",\\"capacity\\":8}]"	\N	\N	"[{\\"id\\":\\"hotel-1768137363515\\",\\"location\\":\\"Gantok \\",\\"name\\":\\"leo International \\"},{\\"id\\":\\"hotel-1768197247403\\",\\"location\\":\\"Darjeeling \\",\\"name\\":\\"Moonlight \\"}]"	\N	\N	1 Pickup time 10:00 AM sharp from NJP Parking. Late arrivals must manage on their own. \n2 Please do not book Uttarbanga Express for return  its timing doesnt match with tour drop. \n3 This is a Standard Category Tour  kindly dont expect Deluxe-level services. \n4 Nathula Pass is fully Army Permit controlled. Not all vehicles may get permits. If Nathula is denied, 350 per head will be refunded. \n5 On Nathula day, lunch will be self-managed. We will provide 200 per head in cash, as hotel lunch is possible only after 5:00 PM. Guests can enjoy lunch en route at their convenience. (Driver Assist) \n6 On return day (Darjeeling  NJP via Mirik), lunch will also be self-managed. We will again provide 200 per head in cash at Mirik, as food will be outside the hotel meal plan.(Driver Assist) \n7 Please cooperate with timings, group discipline, and local rules for a smooth & memorable trip.	\N	INR	\N	\N	Darjeeling - Gangtok 4n5d	\N	\N	\N	\N	\N	\N	\N	STT-GT-018	f	\N	f
